import { useQuery ,useMutation, gql } from '@apollo/client'

const LOGIN_MUTATION = gql`
    mutation LOGIN_USER($email: String!, $password: String!) {
        loginUser(email: $email, password: $password) {
            token
        }
    }
`

const ALL_USER_QUERY = gql`
    query {
        users {
            id
            fullName
        }
